import React, { useState, useEffect } from "react";
import createSubjectPage from "./components/createSubjectPage";
import NavBar from "./components/NavBar";
import "./index.css";

function App() {
  const [data, setData] = useState("");
  let clicker = 0;

  useEffect(() => {
    console.log(`useEffect is in effect`);
    const makeApiCall = async () => {
      const res = await fetch(`https://swapi.dev/api/planets/`);
      const json = await res.json();
      console.log(json);
      setData(json);
    };
    makeApiCall();
  }, []);

  const buttonFunction = () => {
    console.log(`Data incoming:`);
    console.log(data.results[clicker]);
    clicker += 1;
  };

  return (
    <div>
      <NavBar></NavBar>
      <createSubjectPage data={data}></createSubjectPage>
      <h1
        id="title"
        style={{
          textAlign: "center",
          color: "yellow",
          width: "200px",
          position: "absolute",
          top: "500px",
        }}
      >
        STAR WARS
      </h1>
      <h3
        className="thinnerStarWarsFont"
        style={{
          textAlign: "center",
          width: "500px",
          margin: "auto",
        }}
      >
        May the Force be with you.
      </h3>
      <button onClick={buttonFunction}>Click me for Data</button>
    </div>
  );
}

export default App;
